import styled from 'styled-components';
import Announcement from '../Components/Announcement';

const Container = styled.div`
    display: grid;
    grid-template-column: repeat(2, 1fr);
`;

export default function Detail() {
    return (
        <>
            <Announcement />
            <Container>
                <h1>Left</h1>
                
            </Container>
        </>
    );
}
